import styled from "styled-components";

export const Container = styled.div`
margin-top: 40px;
`;
export const ProductList = styled.div`
  display: flex;
  justify-content: center;
  width: 100%;

  ul {
    list-style: none;
    display: flex;
    justify-content: center;
    flex-wrap: wrap;
    gap: 20px;

  }
`;
